import 'package:meta/meta.dart';import 'dart:convert';List<Prodect1> prodect1FromJson(String str) => List<Prodect1>.from(json.decode(str).map((x) => Prodect1.fromJson(x)));String prodect1ToJson(List<Prodect1> data) => json.encode(List<dynamic>.from(data.map((x) => x.toJson())));class Prodect1 {  Prodect1({    required this.id,    required this.title,    required this.banner,    required this.description,    required this.category,    required this.colors,    required this.price,    required this.isAvailable,    required this.showHide,    required this.isFeatured,    required this.productImage,  });  int id;  String title;  String banner;  String description;  Category category;  List<Color> colors;  int price;  bool isAvailable;  bool showHide;  bool isFeatured;  List<ProductImage> productImage;  factory Prodect1.fromJson(Map<String, dynamic> json) => Prodect1(    id: json["id"],    title: json["title"],    banner: json["banner"],    description: json["description"],    category: Category.fromJson(json["category"]),    colors: List<Color>.from(json["colors"].map((x) => Color.fromJson(x))),    price: json["price"],    isAvailable: json["is_available"],    showHide: json["show_hide"],    isFeatured: json["is_featured"],    productImage: List<ProductImage>.from(json["product_image"].map((x) => ProductImage.fromJson(x))),  );  Map<String, dynamic> toJson() => {    "id": id,    "title": title,    "banner": banner,    "description": description,    "category": category.toJson(),    "colors": List<dynamic>.from(colors.map((x) => x.toJson())),    "price": price,    "is_available": isAvailable,    "show_hide": showHide,    "is_featured": isFeatured,    "product_image": List<dynamic>.from(productImage.map((x) => x.toJson())),  };}class Category {  Category({    required this.title,  });  String title;  factory Category.fromJson(Map<String, dynamic> json) => Category(    title: json["title"],  );  Map<String, dynamic> toJson() => {    "title": title,  };}class Color {  Color({    required this.colorCode,  });  String colorCode;  factory Color.fromJson(Map<String, dynamic> json) => Color(    colorCode: json["color_code"],  );  Map<String, dynamic> toJson() => {    "color_code": colorCode,  };}class ProductImage {  ProductImage({    required this.images,  });  String images;  factory ProductImage.fromJson(Map<String, dynamic> json) => ProductImage(    images: json["images"],  );  Map<String, dynamic> toJson() => {    "images": images,  };}